import React from 'react';
import './About.css';
import { Card, CardHeader, CardBody, CardFooter, Text, Box, Heading } from '@chakra-ui/react';

function About() {
  return (
    <div className='about'>
        <Card maxW='sm'>
            <CardBody>
            <Heading size='xl'>About Alumni Cell</Heading>
            <Text>....................................................</Text>
            </CardBody>
        </Card>
    </div>
  )
}

export default About
